    private void jButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton2ActionPerformed
        // TODO add your handling code here:
        try {
            Connection con = dbconnection.getconnection();
             ResultSet rs =null;
        PreparedStatement pst = null;
            pst = con.prepareStatement("Select id,name,term,Pamount,Famount,interest from policy");
            rs = pst.executeQuery();
            ResultSetMetaData stData = null;
            stData = rs.getMetaData();
            int q = stData.getColumnCount();
            
            DefaultTableModel RecordTable = (DefaultTableModel)jTable7.getModel();
            RecordTable.setRowCount(0);
                    
                    while(rs.next()){
                        Vector columnData = new Vector();
                        
                        for(int i=0; i<=q; i++)
                        {
                            columnData.add(rs.getString(1));
                            columnData.add(rs.getString(2));
                            columnData.add(rs.getString(3));
                            columnData.add(rs.getString(4));
                            columnData.add(rs.getString(5));
                            columnData.add(rs.getString(6));
                          
                 
                        
                        } 
                          RecordTable.addRow(columnData);
                    }
        }
        
             catch (SQLException ex) {
                 JOptionPane.showMessageDialog(this, "ERROR ");
            }
        
    }//GEN-LAST:event_jButton2ActionPerformed

